$font12: 0.75rem;
$font14: 0.875rem;
$font16: 1rem;
$font18: 1.125rem;
$font22: 1.375rem;

$bold: 700;
$semibold: 500;
$regular: 400;

@mixin bodyFont($size, $weight) {
   font-family: $bodyFont;
   font-size: $size;
   font-weight: $weight;
   line-height: calc(#{$size} + 0.5rem);
}
@mixin accentFont($size, $weight) {
   font-family: $accentFont;
   font-size: $size;
   font-weight: $weight;
   line-height: calc(#{$size} + 0.5rem);
}

sources.sass/_core/_reset.scss:
* {
   margin: 0;
   padding: 0;
   list-style: none;
   // border: 0;
   -webkit-tap-highlight-color: transparent;
   text-decoration: none;
   color: inherit;
