        display: flex;
        flex-direction: column;
        align-items: center;
    }

    @include tablet {
        order: 2;
    }

    &__list {
        @include tablet {
            opacity: 0;
            height: 0;
            pointer-events: none;
            transition: all 0.3s 0.1s ease, opacity 0.15s ease;
            overflow: hidden;
        }
    }

    &__expandBtn {
        display: none;

        @include tablet {
            display: flex;
            cursor: pointer;
            background: var(--accentColor);
            -webkit-background-clip: text;
            -webkit-text-fill-color: transparent;
            transition: all 0.3s ease;

            i {
                @include icon24;
            }
        }

    }

    &.show {
        #{$this} {
            &__list {
                opacity: 1;
                pointer-events: all;
                transition: all 0.3s ease;
                margin-bottom: 16px;
                // overflow: initial;
            }

            &__expandBtn {
                transform: rotate(180deg);
            }
        }
    }
}

