sources.sass/modules/_mainNav.scss:
.mainNav {
    $shadow: 0px 4px 8px rgba(0, 0, 0, 0.15);
    height: 112px;
    display: flex;
    align-items: center;
    z-index: 1;
    transition: all 0.4s ease;
    position: absolute;
    width: 100%;
    top: 0;
    left: 0;

    @include tablet {
        position: sticky;
        height: 64px;
        margin-bottom: 24px;

    }

    &.sticky {
        position: sticky;
        top: 0;
        background: var(--mainNavBg);
        box-shadow: $shadow;


    }

    &__content {
        grid-column: 1/13;
        display: flex;
        justify-content: space-between;

    }

    &__settings {
        display: flex;
        gap: 48px;

        @include tablet {
            background: var(--mainNavBg);
            width: 100%;
            position: fixed;
            left: 0;
            top: -30%;
            padding: 48px 24px;
            flex-direction: column;
            z-index: 2;
            box-shadow: 0px 4px 80px rgba(0, 0, 0, 0.15);
            gap: 40px;
            border-bottom: 1px solid var(--settingsOutline);
            opacity: 0;
            transition: top 0.4s ease, opacity 0.2s ease;

        }



        &.open {
            opacity: 1;
            top: 0;
        }
    }

    &__settingsBtn {
        display: none;

        @include tablet {
            @include accentFont($font12, $regular);
            display: flex;
            align-items: center;
            gap: 8px;
            color: var(--settingsText);

            cursor: pointer;

            i {
                @include icon24;
            }
        }

        &--close {
            @extend .mainNav__settingsBtn;
            position: absolute;
            top: 24px;
            right: 24px;

        }
    }

    &__mode,
    &__fonts,
    &__themes {

        display: flex;
        gap: 8px;
        align-items: center;

        @include tablet {
            flex-wrap: wrap;
            gap: 16px;
        }

    }

    &__items {
        display: flex;
        gap: 8px;

        @include tablet {
            gap: 12px;
            flex-wrap: wrap
        }
    }

    &__text {
        @include accentFont($font12, $regular);
        color: var(--settingsText);
    }

    &__toggle {
        position: relative;
        width: 48px;
        height: 24px;
        background: var(--toggleBg);
        border-radius: 40px;
        border: 2px solid var(--settingsOutline);
        display: flex;
        align-items: center;
        box-shadow: $shadow;
        cursor: pointer;

        &:before {
            width: 16px;
            height: 16px;
            position: absolute;
            content: '';
            background: $neu-01;
            border-radius: 50%;
            left: 2px;
            box-shadow: $shadow;
            transition: all 0.3s ease;
        }

        &.on {
            &:before {
                left: 26px;
                background: var(--accentColor);
            }
        }
    }

    &__font {
        position: relative;
        width: 24px;
        height: 24px;
        border: 2px solid var(--settingsOutline);
        background: var(--toggleBg);
        border-radius: 50%;
        box-sizing: border-box;
        display: flex;
        align-items: center;
        justify-content: center;
        cursor: pointer;
        box-shadow: $shadow;
        opacity: 0.6;
        transition: opacity 0.2s ease;
        color: var(--settingsText);

        &:nth-of-type(1) {
            @include accentFont($font14, $semibold);
            font-size: 14px;
        }

        &:nth-of-type(2) {
            @include accentFont($font16, $semibold);
            font-size: 16px;
        }

        &:nth-of-type(3) {
            @include accentFont($font18, $semibold);
            font-size: 18px;
        }

        &.selected {
            border-color: var(--settingsOutlineSelected);
            opacity: 1;
        }

    }

    &__color {
        position: relative;
        width: 24px;
        height: 24px;
        border: 2px solid var(--settingsOutline);
        background: var(--accentColor);
        border-radius: 50%;
        box-sizing: border-box;
        display: flex;
        align-items: center;
        justify-content: center;
        cursor: pointer;
        box-shadow: $shadow;
        opacity: 0.6;
        transition: opacity 0.2s ease;

        &[data-theme-color="random"] {
            overflow: hidden;
            background: transparent;

            span {
                display: flex;
                position: absolute;
                width: 40px;
                height: 18%;
                background: $gra-02;
                display: flex;
                align-items: center;
                justify-content: center;
                top: 1px;
                transform: rotate(-45deg);
                transform-origin: center center;

                &:before,
                &:after {
                    width: 100%;
                    height: 100%;
                    position: absolute;
                    content: '';
                }

                &:before {
                    top: -97%;
                    background: $gra-01;
                }

                &:after {
                    top: initial;
                    bottom: -97%;
                    background: $gra-03;
                }

                &:nth-of-type(2) {
                    top: initial;
                    bottom: 1px;
                    background: $gra-05;

                    &:before {
                        background: $gra-04;
                    }

                    &:after {
                        bottom: -97%;
                        background: $gra-06;
                    }
                }
            }
        }

        &.selected {
            border-color: var(--settingsOutlineSelected);
            opacity: 1;
        }

        &:hover {
            opacity: 1;
        }

    }




}

sources.sass/_core/_layout.scss:
.content {
   min-height: 100vh;
   display: flex;
   align-items: center;
   justify-content: center;
   padding: 120px 0;

   @include tablet {
      padding: 0;
   }

}

.wrapper {
   max-width: $desktop;
   width: 100%;
   margin: 0 auto;
   padding: 0 64px;
   display: grid;
   grid-template-columns: repeat(12, 1fr);
   grid-column-gap: 24px;

   @include tablet {
      padding: 0 40px;
      grid-template-columns: repeat(6, 1fr);
   }

   @include mobile {
      padding: 0 24px;
   }
}

.blocks {
   grid-column: 2/12;
   display: flex;
   justify-content: center;
   gap: 24px;
   transition: all 0.3s ease;
   overflow-x: hidden;

   @include laptop {
      grid-column: 1/13;
   }

   @include tablet {
      grid-column: 2/6;
      flex-direction: column;
      align-items: center;
   }

   @include phablet {
      grid-column: 1/7;
   }
}

:focus-visible {
   border-radius: 8px;
   border: 1px solid var(--focus);
}

input,
textarea {
   &:focus-visible {
      border: 0;
      outline: 0;
   }
}

sources.sass/main.scss:
@import "_core/_reset.scss";
@import "_core/_breakpoints.scss";
@import "_core/_colors.scss";
@import "_core/_typography.scss";
@import "_core/_iconography.scss";
@import "_core/_components.scss";
@import "_core/_modules.scss";
@import "_core/_layout.scss";

html {
   scroll-behavior: smooth;
   font-size: 16px;

   &[data-font-size="small"] {
      font-size: 14px;
   }

   &[data-font-size="normal"] {
      font-size: 16px;
   }

   &[data-font-size="large"] {
      font-size: 18px;
   }
}

body {
   width: 100vw;
   font-family: $bodyFont;
   background: var(--bgBody);

}

* {
   transition: font-size 0.2s ease;
}
